  input: TEXT,"F3XA","","This amendment is in response to your letter dated February
    13, 2007 regarding the Committee's Pre-General report covering the period October
    1-18, 2006.  Memo entries for itemization of disbursements disclosed on Schedule
    H4 have been provided.  The Committee further amended it's H4 to include a memo
    text that provides clarification for its description of payroll processing charges.  This
    is a service fee for payroll processing such as filing taxes and cutting checks,
    not a salary payment for an individual(s).  The Committee was also asked to provide
    further clarification of its description of office supplies.  Payments listed
    on Schedule H4 for office supplies were payments either to vendors, or as reimbursements
    to individuals for basic supplies used for day-to-day operations of the Committee's
    various offices throughout the state. These items included, but are not limited
    to pens, paper, paper clips, pencils, ink, toner, video tapes, CDs, cups, toilet
    paper, paper towels, tissues, trash bags, coffee, tape, extension cords, light
    bulbs, labels, folders, organizers, envelopes, cartridges, soap, cleaning products,
    etc.  The Committee disclosed payments for Salaries/Wages for this period on Schedule
    H4 for Line 21a, and Schedule B for Line 30b.  The Committee pays its employees
    with 100% federal funds, and disclosed the expenditures on Line 30b when the individual
    spends more than 25% of their compensated time in a given month on Federal election
    activity or activities in connection with a Federal election.  Those individuals
    who spend 25% or less of their compensated time in a given month on Federal election
    activity or activities in connection with a Federal election are paid with Federal
    funds, and allocated on Schedule H4.  In either case, all amounts spent for employee
    specific 'fringe benefits,' consisting of health insurance, disability insurance,
    life insurance, retirement benefits and payroll taxes are paid for, and reported
    on a proportional basis equal to the amount associated with the individual that
    received the compensation and the funds with which the individual was paid.  Any
    reimbursements/allocation transfers to the Committee's federal account from the
    Committee's non-federal account for salaries, and/or benefits are associated with
    individuals whose activities do not exceed 25% in a given month.  Receipts reported
    on Schedule A for Line 17, unless otherwise noted, are for the purchase of access
    to the Committee's voter file.  The Committee believes that this price properly
    reflects the fair market value of the file, which represents the normal charge
    for such data in our state.  All costs associated with the voter file are paid
    100% out of the federal account and are therefore not allocable."
